const cards_es_namespaceObject = JSON.parse('[{"id":1,"name":"El Tonto","description":"El Tonto simboliza la curiosidad, la mente abierta, la prontitud para los experimentos y las acciones espontáneas. Es capaz de improvisar, también puede causar imprevistos y caos.","meaning":"Nuevo comienzo, curiosidad, apertura a algo nuevo en la vida, acciones espontáneas. Apertura, caos inminente, deseo de probar algo nuevo y repentino.","emotions":"Tú tratas el tema con curiosidad y ganas de probar todo lo nuevo","proposal":"Olvídate de todas las preocupaciones y planes, deja cualquier seriedad y toda precaución. Prueba algo nuevo. Sigue adelante sin preocupaciones y confía en tus instintos para mantenerte a salvo en caso de peligro.","perspectives":"Ante ti se encuentra una nueva empresa, todas las puertas están abiertas para ti. Si estás listo para reaccionar espontáneamente e improvisar de buena gana, esta empresa será muy viable y te traerá una gran alegría.","love":"En el amor y las relaciones - debilidad, alegría y alegría.","profession":"En profesión - nuevo comienzo, amateurismo.","generally":" En general - descuido, nuevos comienzos y caos."},{"id":2,"name":"El Mago","description":"El Mago simboliza la actividad, la presencia de ideas y la fuerza para poner las cosas en marcha, resolver problemas y afrontar tareas.","meaning":"Mostrar iniciativa, poner la situación en marcha, creatividad activa.","emotions":"Te sientes fuerte y competente, estás fascinado con el tema. Estás listo para comenzar la acción.","proposal":"Demuestra iniciativa. Pon las cosas en movimiento. Muestra determinación y una gran disposición para enfrentar los desafíos que se te presenten.","perspectives":"Tienes buenas inclinaciones. Encontrarás la decisión correcta y el camino correcto para convertirte en un maestro.","love":"En el amor y las relaciones - encanto, atractividad, voluntad.","profession":"En profesión - maestría, éxito, autoridad.","generally":"En general - influencia, iniciativa, acción dinámica."},{"id":3,"name":"La Suma Sacerdotisa","description":"La Suma Sacerdotisa representa el conocimiento intuitivo y la voluntad de esperar pacientemente la oportunidad adecuada.","meaning":"Fe en la voz interior, intimidad, comprensión, indulgencia y dulzura.","emotions":"Tienes un conocimiento muy profundo del problema y buen estilo. Esperas el momento adecuado para responder apropiadamente.","proposal":"Todo tiene su tiempo. Cree que todo estará bien y estarás en el lugar correcto en el momento correcto, confiando en tu intuición.","perspectives":"Las cosas irán bien si confías en tu voz interior y le das suficiente tiempo para desarrollar el tema.","love":"En el amor y las relaciones - comprensión profunda, parentesco de las almas, armonía.","profession":"En la profesión - confianza instintiva, sueños que se hacen realidad.","generally":"En general - sutileza de sentimientos, paciencia, devoción, aplomo."},{"id":4,"name":"La Emperatriz","description":"la Emperatriz representa a la Madre Naturaleza, el crecimiento, la fertilidad y toda la vida.","meaning":"Crecimiento, desarrollo y fertilidad de la vida.","emotions":"Estás seguro de que se le dará desarrollo al tema y estás listo para prestarle toda la atención.","proposal":"Cree en los ritmos naturales. Si has nutrido tu idea durante mucho tiempo, se le dará forma y desarrollo.","perspectives":"Tu negocio tendrá un buen desarrollo. Encontrarás suelo fértil en el que todo crecerá y se desarrollará bien.","love":"En el amor y las relaciones - vivacidad, novedad, elevación.","profession":"En profesión - buen desarrollo, tareas creativas, base saludable.","generally":"En general - crecimiento, obtención de suelo fértil."},{"id":5,"name":"El Emperador","description":"El Emperador representa la realidad, la responsabilidad, la certeza, la constancia, el orden y la estructura.","meaning":"Estructura, orden y certeza. El emperador aparece donde una idea toma forma material, los planes cobran vida.","emotions":"Te sientes seguro, independiente y competente. Asumirás toda la responsabilidad para garantizar que el tema de la pregunta encuentre una encarnación concreta, reciba una base y un desarrollo confiables.","proposal":"Muéstrate como una persona responsable y concéntrate en los puntos esenciales del problema. Avanza con perseverancia sin perder el realismo.","perspectives":"Puedes lograr resultados duraderos y duraderos, implementar planes y construir algo fundamental.","love":"En el amor y las relaciones - relaciones sólidas, confianza.","profession":"En profesión - metas claras, éxito.","generally":"En general - la implementación de planes, mantenimiento del orden."},{"id":6,"name":"El Hierofante","description":"El Hierofante representa la sabiduría, la búsqueda de la verdad y encontrarla, el optimismo y la fe, así como la protección y la guía.","meaning":"Confianza y optimismo. Encontrar la verdad y actuar racionalmente.","emotions":"Te acercas a un tema con franqueza, de manera positiva y con confianza, te das cuenta completamente y tiene un profundo significado para ti.","proposal":"Sigue adelante con optimismo, pensando constantemente en el significado de lo que está sucediendo. Haz solo lo que no sea contrario a tu conciencia.","perspectives":"Realmente puedes tomar una acción racional y lograr el éxito. Estarás muy satisfecho con el resultado de tus acciones.","love":"En el amor y las relaciones - confianza mutua, franqueza, matrimonio.","profession":"En la profesión - tareas significativas, salud ética.","generally":"En general - experiencia racional, confianza, buenos consejos."},{"id":7,"name":"Los Amantes","description":"Los amantes representan el poder magnético de los opuestos del amor humano y la elección del amor.","meaning":"Amor u otra decisión tomada por el corazón.","emotions":"Tu corazón ha estado buscando la decisión correcta durante mucho tiempo y ahora estás completamente listo para tomar una decisión.","proposal":"Toma una decisión importante estando en armonía contigo mismo y con tu corazón.","perspectives":"Tienes buenas perspectivas. Estás dando un paso en el camino que tu corazón desea y tienes todos los motivos para alegrarte.","love":"En el amor y las relaciones - gran amor, elección.","profession":"En la profesión - actitud mental hacia las propias tareas profesionales.","generally":"En general - libre elección, armonía."},{"id":8,"name":"El Carro","description":"El carro representa salir al mundo, superar las contradicciones y avanzar rápidamente.","meaning":"Un nuevo comienzo, es hora de superar con valentía las contradicciones y destruir las dudas.","emotions":"Tienes el deseo de avanzar y no dejas que las dudas te destruyan. Aportas alcance y escala al tema y avanzas hacia tu objetivo.","proposal":"No lo dudes y no dudes de ti mismo. Fíjate una meta y avanza hacia ella con coraje y determinación.","perspectives":"Debes avanzar hacia tu objetivo rápido y alegremente.","love":"En el amor y las relaciones - nuevas relaciones, \\"viento fresco\\", superación de conflictos, relaciones que progresan rápidamente.","profession":"En la profesión - nuevos comienzos, independencia, espíritu pionero.","generally":"En general - coraje, espíritu emprendedor, migración, viajes, movimiento."},{"id":9,"name":"La Fuerza","description":"La fuerza representa la domesticación y el dominio de los instintos, pero no a través de la presión y la violencia. Indica vitalidad, deseo y pasión.","meaning":"Deseo y pasión. Caminando tu camino con energía e inspiración.","emotions":"Te sientes lleno de fuerza y energía, listo para involucrarte intensamente en el tema, si es necesario, incluso luchar por eso.","proposal":"Sé apasionado y lleno de deseo. Prepárate, si es necesario, para mostrar tus garras y luchar como un león.","perspectives":"Los eventos serán muy intensos, tendrás muchas razones para alegrarte. Sentirás el poder atravesándote y te sentirás aún más vivo.","love":"En el amor y las relaciones - deseo, pasión, drama.","profession":"En la profesión - contratación, éxito, voluntad de competir.","generally":"En general - vitalidad, ganas de vivir, \\"demostración de garras\\"."},{"id":10,"name":"El Ermitaño","description":"El ermitaño simboliza la concentración interior, el autoconocimiento y la creencia en uno mismo. Significa una acción prudente, seria e independiente.","meaning":"Prudencia y autoconocimiento. Necesitas entender lo que realmente quieres y mantener la fe en tus intenciones.","emotions":"Te tomas el tema con la debida seriedad y tienes la intención de desarrollarlo de la manera que tu intuición te indique.","proposal":"Mira dentro de ti mismo y ve lo que realmente quieres y cuál es tu verdadero camino. La integridad que obtengas de esta manera te dará claridad de intención y te permitirá ser determinado y resuelto.","perspectives":"Actúas de manera seria y verdadera. Ves claramente lo que es correcto para ti. Encontrarás tu propio camino y lo seguirás sin dudarlo.","love":"En el amor y las relaciones - lealtad a uno mismo, seriedad.","profession":"En la profesión - verificar la propia meta, el propio camino.","generally":"En general - soledad, paz, desapego, recuerdos."},{"id":11,"name":"Rueda de la fortuna","description":"La rueda de la fortuna simboliza la rueda del tiempo, que a lo largo de la vida nos asigna una tarea tras otra, a partir de la cual, como piedras de mosaico, forma una imagen de nuestro objetivo principal en la vida.","meaning":"Una tarea vital que se te ha asignado ahora mismo y requiere una solución inmediata.","emotions":"Sabes que ahora es el momento de dedicarte al tema y que tienes la fuerza y la capacidad para realizar la tarea de la mejor manera posible.","proposal":"Es hora de dedicarte al tema sobre el que preguntaste. Trátalo como tu tarea de vida, que puedes y debes completar.","perspectives":"Este es tu propio camino. Debes ver cuál es la misión de tu vida, cuál es tu vocación y cómo será tu futuro. Debes ser capaz de manejar los desafíos de la vida.","love":"En el amor y las relaciones - momento adecuado para resolver problemas, afecto fatídico.","profession":"En la profesión - tareas que deben completarse ahora, el camino hacia una profesión.","generally":"En general - es un buen momento para dedicarse a resolver los problemas de la vida."},{"id":12,"name":"La Justicia","description":"La justicia es una decisión justa, análoga a un juicio integral, reflexivo y equilibrado. Esta carta muestra que el interrogador mismo es responsable de la situación y de su desarrollo posterior.","meaning":"Tomando una decisión bien pensada. Debes estar preparado para aceptar la responsabilidad.","emotions":"Eres responsable del tema, buscas soluciones razonables y maduras y luchas por la honestidad y la imparcialidad.","proposal":"Asume la responsabilidad y llega a una decisión justa y honesta. Prepárate para el hecho de que más tarde recogerás los frutos de lo que se ha sembrado ahora.","perspectives":"Tomarás una sabia decisión y obtendrás un resultado justo. Cosecharás lo que siembras.","love":"En el amor y las relaciones - igualdad, sentido de la responsabilidad.","profession":"En profesión - honestidad, corrección. Lo que siembras es lo que cosechas.","generally":"En general - elegir una solución sensata y probada críticamente, responsabilidad personal."},{"id":13,"name":"El Colgado","description":"El Colgado simboliza un mundo al revés. La carta significa estancamiento, inmersión en profundidad, conocimiento que llega a través de la inmersión en uno mismo, la necesidad de sacrificio y un giro radical de los acontecimientos.","meaning":"Estancamiento porque el desarrollo de la situación lleva tiempo. La necesidad de aprender un nuevo lado de las cosas para continuar el desarrollo.","emotions":"Eres desamparado, desamparado y pasivo sobre el tema. Esperas, sabiendo que los cambios fundamentales vendrán uno por uno.","proposal":"Mira a tu alrededor y deja de lado las viejas nociones, expectativas y fijaciones. Es hora de sacrificar algo. Para esto, se te puede dar la iluminación y sentirás que una nueva vida despierta en ti.","perspectives":"Te diriges a un callejón sin salida que requerirá toda tu paciencia, pero también te brindará una experiencia de profundo autodescubrimiento. Lo más probable es que necesites cambiar mucho o hacer un sacrificio para superar una situación desfavorable.","love":"En el amor y las relaciones - sacrificio, estancamiento, cambios radicales de personalidad.","profession":"En la profesión - estar bajo control de las circunstancias, calma, cambios necesarios.","generally":"En general - una crisis, una debilidad, una necesidad de cambio."},{"id":14,"name":"La Muerte","description":"La Muerte significa que la situación ha llegado a su final natural. La carta no dice nada acerca de que el final sea triste, o que la persona que pregunta esté feliz con ella, o al menos esté de acuerdo con ella.","meaning":"Adiós y liberación. Entender que una fase particular, un período particular de tiempo está llegando a su fin.","emotions":"Sabes que el tema en su forma anterior está muerto y estás listo para despedirte de él para crear algo nuevo.","proposal":"Tranquilízate. Imagina que es hora de decir adiós a una circunstancia, comportamiento o situación de la vida anterior.","perspectives":"Esto ha terminado. La situación en su forma actual ha llegado a su fin y ha dejado espacio para una nueva.","love":"En el amor y las relaciones - el final de una de las fases de la vida, adiós a los amigos.","profession":"En profesión - el final de un proyecto o asignación anterior.","generally":"En general - final natural, despedida."},{"id":15,"name":"Templanza","description":"La templanza simboliza la proporción correcta, la medida correcta, así como la salud y la armonía. Esta carta también muestra al ángel guardián y soberano de las almas, que conoce el camino hacia la meta más alta.","meaning":"Salud o cordura, ecuanimidad, paz y armonía interior.","emotions":"Estás atento al tema, cuidando la observancia de la medida y de un desarrollo sano y armonioso.","proposal":"Cree en tu ángel de la guarda y deja que él te guíe. Entonces podrás encontrar la forma correcta de resolver los problemas y superar las crisis más difíciles por tu cuenta.","perspectives":"Este camino te llevará a un entorno saludable. Encontrarás paz y armonía.","love":"En el amor y las relaciones - las proporciones correctas, las relaciones afectuosas.","profession":"En profesión - toma el camino correcto, da alegría.","generally":"En general - moderación, ecuanimidad, curación."},{"id":16,"name":"El Diablo","description":"El diablo simboliza la falta de libertad, la frustración, el exceso, la tiranía. En primer lugar, significa que la persona que pregunta está tentada a hacer algo que en realidad no quiere.","meaning":"Dependencia, contradicciones, abuso de poder, intemperancia y tentaciones peligrosas.","emotions":"El tema te atrae mágicamente, pero no estás seguro si se trata de las cosas correctas para ti. O te frustrarás con tus propios impulsos, o tendrás miedo de caer en excesos destructivos y convertirte en adicto.","proposal":"Si juegas con fuego, debes tener cuidado de no quemarte los dedos.","perspectives":"Esté atento. Es posible que se sienta tentado a hacer algo que realmente no desea. Puede volverse confuso, adicto y manipulado.","love":"En el amor y las relaciones - confusión, sumisión, luchas por el poder, lujuria.","profession":"En la profesión - travesuras sucias, falta de libertad, extorsión.","generally":"En general - adicción, seducción, tentación, pasión."},{"id":17,"name":"La Torre","description":"La Torre simboliza la destrucción o incluso el colapso total de una estructura obsoleta desde dentro o desde fuera. Por regla general, la aparición de la Torre en una lectura causa miedo, sin embargo, con una nueva experiencia, la Torre a menudo se percibe como un avance decisivo hacia una mayor libertad.","meaning":"Liberación, renovación, colapso, así como destrucción y guerra.","emotions":"El tema es \\"explosivo\\" para ti. Sientes que lleva a un fracaso.","proposal":"Sal de la raya. Rompe estructuras obsoletas y derrótalas.","perspectives":"Este es un negocio muy arriesgado, lo más probable es que conduzca a un fracaso.","love":"En el amor y las relaciones - una experiencia desalentadora, un colapso de la autoconciencia.","profession":"En profesión - despido, colapso de la situación, grandes cambios.","generally":"En general - destrucción, salirse de la línea, derrumbarse..."},{"id":18,"name":"La Estrella","description":"La Estrella simboliza maravillosos planes a largo plazo. Después de las crisis pasadas, la Estrella del Arcano, en primer lugar, simboliza un futuro maravilloso. En este futuro, el interrogador tendrá muchas más bendiciones de las que puede imaginar.","meaning":"Planes a largo plazo, un futuro lejano y hermoso, esperanza y confianza.","emotions":"No te interesan los beneficios a corto plazo, sino las perspectivas a largo plazo. En el tema ves un nuevo emprendimiento, una nueva etapa de tu vida, tal vez un \\"deshielo\\" después de los choques de vidas pasadas. tener una actitud positiva hacia el tema y creer que las cosas se desarrollarán bien.","proposal":"No te fijes metas pequeñas. Observa los eventos a vista de pájaro para ganar aún más visibilidad y ampliar tus horizontes. Cree en tu brillante futuro, tienes todos los motivos para hacerlo.","perspectives":"Un futuro lejano se abre ante ti, en el que te irá bien, quizás incluso mucho mejor de lo que puedas imaginar.","love":"En el amor y las relaciones - planes grandes para un futuro lejano.","profession":"En la profesión - éxito, proyectos prometedores a largo plazo.","generally":"En general - fe en el futuro, felicidad, buena suerte."},{"id":19,"name":"La Luna","description":"La luna simboliza las aprensiones y los miedos. Esta carta representa la situación que tememos. A menudo indica el último obstáculo importante que debe superarse para alcanzar la meta.","meaning":"Una fase oscura de la vida, una situación que debe superarse cuidadosamente.","emotions":"Tienes miedo del tema, estás lleno de incertidumbre y te preocupa que te hayas perdido en la oscuridad.","proposal":"Recorre el camino del miedo, pero con cuidado. Lo principal ahora no son las ganancias violentas, sino el progreso cuidadoso, el control de la situación.","perspectives":"Estás pasando por una fase precaria de la vida, un predicamento. Puedes lastimarte fácilmente. Quizás esta sea la última barrera que debes superar, o deberías ser más sabio y tomar un camino diferente.","love":"En el amor y las relaciones - vagando en la oscuridad, anhelo inquieto, miedo.","profession":"En la profesión - la emoción antes de una actuación, un paso significativo pero difícil.","generally":"En general - incertidumbre, miedo, vergüenza, una barrera importante."},{"id":20,"name":"El Sol","description":"El sol representa la alegría de vivir, el descuido, la energía solar. Simboliza el renacimiento después de una crisis, muestra que realmente se han superado todas las dificultades.","meaning":"Autoexpresión y transición al lado soleado.","emotions":"El tema no es una carga para ti, la situación te favorece y se desarrolla rápidamente. Tienes confianza y un corazón generoso.","proposal":"No te preocupes por nada, pero sigue adelante con un corazón descuidado. Sé despreocupado y optimista.","perspectives":"El sol viene hacia ti. La alegría y el éxito te esperan, y quizás te sientas renacido.","love":"En el amor y las relaciones - cordialidad, tiempos soleados, iluminados por el sol.","profession":"En la profesión - éxito, confianza, alegría obtenida del trabajo.","generally":"En general - alegría, generosidad, alegría, confianza en uno mismo."},{"id":21,"name":"El Juicio","description":"El juicio simboliza la liberación y la curación verdaderas. La carta también puede significar que algo perdido anteriormente renace o que algo inconsciente se está reencarnando en su hermosa forma verdadera.","meaning":"Búsqueda de la verdadera liberación, curación o obtención de tesoros.","emotions":"Ves en el tema el verdadero valor que puedes ganar y crees en la liberación venidera.","proposal":"Ha llegado el momento de adquirir todo lo real y esencial, y deshacerse de todo lo falso y superficial.","perspectives":"El camino de la liberación está sobre ti. Tal vez algo de valor real está llegando a tu vida, algo que antes no era obvio para ti.","love":"En el amor y las relaciones - un milagro, encontrar \\"tesoros\\", el fin del sufrimiento.","profession":"En profesión - liberación, búsqueda de liberación, producción de valores.","generally":"En general - una victoria del bien, liberación o liberación."},{"id":22,"name":"El Mundo","description":"La paz significa una meta alcanzada. En el nivel externo, significa encontrar el lugar propio en la vida, la profesión correcta, relaciones armoniosas. En el nivel interno, significa encontrar la integridad como la meta más alta del proceso de convertirse en un persona.","meaning":"Encontrar el lugar de uno en la vida, la actitud correcta, sentir la plenitud de la vida.","emotions":"Eres positivo y sientes que perteneces.","proposal":"Mantén tu objetivo en mente. Es alcanzable. Asegúrate de tomar la posición correcta y disfrutar de la vida.","perspectives":"Este camino te lleva a tu meta. Aquí encontrarás tu lugar en la vida, tu hogar.","love":"En el amor y las relaciones - logro de la meta, armonía, felicidad y alegría.","profession":"En la profesión - la tarea correcta, el lugar correcto, la actitud correcta.","generally":"En general - logro de una meta, encontrar el lugar de uno."},{"id":23,"name":"As de Bastos","description":"Cada As espera su oportunidad. El As de Bastos significa creatividad, autodesarrollo, vitalidad, coraje y espíritu emprendedor.","meaning":"Una oportunidad que se te ha dado y que debes aprovechar. Tiene potencial para el autodesarrollo, la vitalidad, la inspiración, el coraje y la empresa.","emotions":"Eres consciente de que el tema es una buena oportunidad para ti. Eres optimista y estás decidido a lograr tu máximo rendimiento.","proposal":"Date cuenta de que la oportunidad adecuada está por venir. Aprovéchala, pero prepárate para los tiempos difíciles que se avecinan.","perspectives":"Frente a ti se encuentra las verdaderas, se podría decir, \\"oportunidades calientes\\", que puedes usar con éxito con coraje y empresa.","love":"En el amor y las relaciones - una oportunidad para una nueva vitalidad, llena de acontecimientos, momentos de vida.","profession":"En procesión - nuevas oportunidades, dinámica y empresa.","generally":"En general - una oportunidad para el autodesarrollo, el coraje y la fuerza de voluntad."},{"id":24,"name":"Dos de Bastos","description":"El Dos de Bastos simboliza la indiferencia descontenta de un hombre que lo tiene todo y por lo tanto no se alegra de nada y no quiere nada.","meaning":"Neutralidad, pero posiblemente también obligaciones incumplidas, charla ociosa.","emotions":"Estás indeciso sobre el tema. Hasta ahora, no has decidido por ti mismo si lo necesitas o no, por lo tanto, estás pensando y lleno de dudas.","proposal":"Mantente al margen en este asunto y mantente neutral. Ahora no es el momento de actuar.","perspectives":"Probablemente estés tan absorto en la indiferencia que no te involucres en la situación. En el peor de los casos, podría ser un punto muerto. In the worst case, it could be a stalemate.","love":"En el amor y las relaciones - cowardice, sluggish feelings.","profession":"En la profesión - palabras vacías, vacilación, intenciones poco claras.","generally":"En general - neutralidad, evasividad, confesiones hipócritas."},{"id":25,"name":"Tres de Bastos","description":"El Tres de Bastos muestra una base sólida, gran resistencia y perspectivas prometedoras.","meaning":"Una base sólida y perspectivas favorables.","emotions":"Sientes que estás sobre una base sólida, confiado y lleno de esperanza. Sabes que las cosas te irán bien.","proposal":"Cree en ti mismo y en la tierra firme bajo tus pies. Estás libre de obligaciones y tienes todas las razones para mirar hacia el futuro con confianza.","perspectives":"Tu camino conduce a una base sólida, descubres un futuro brillante.","love":"En el amor y las relaciones - una base sólida, una base, relaciones prometedoras.","profession":"En la profesión - perspectivas sólidas y sobresalientes.","generally":"En general - confianza, confiabilidad y éxito."},{"id":26,"name":"Cuatro de Bastos","description":"El Cuatro de Bastos simboliza la confianza, la apertura y la alegría de vivir.","meaning":"Alegría y apertura, relaciones pacíficas y amistosas.","emotions":"Te sientes seguro y abordas el tema de una manera alegre y abierta.","proposal":"No te preocupes, estás protegido. Ve a la gente o invita a otros a tu casa.","perspectives":"Puedes sentirte seguro y abierto. Serás bienvenido en todas partes.","love":"En el amor y las relaciones - apertura mutua, seguridad, estado de ánimo alegre.","profession":"En la profesión - alegría, felicidad, apertura, nuevos contactos.","generally":"En general - ser bienvenido y dar la bienvenida a los demás, alegría."},{"id":27,"name":"Cinco de Bastos","description":"El Cinco de Bastos muestra a niños que miden su fuerza luchando entre sí con varitas. Es un juego, un evento deportivo, sin nada de siniestro. It\'s a game, a sporting event, with nothing sinister about it.","meaning":"Competencia sana, intensa, dinámica y con buenas perspectivas.","emotions":"Ves el tema como una oportunidad para demostrar tus habilidades y conocimientos en la competencia. Estás preparado para el desafío.","proposal":"Toma un enfoque deportivo de la situación. No te preocupes por posibles conflictos de interés. Tienes todas las posibilidades de lograr tus objetivos.","perspectives":"Hay un período de vida tenso en el que debes demostrar de lo que eres capaz. Saldrás maduro de este desafío.","love":"En el amor y las relaciones - conflicto con una pareja.","profession":"En la profesión - enfrentar la competencia, medir la fuerza de uno.","generally":"En general - un desafío, una competencia, una experiencia intensa."},{"id":28,"name":"Seis de Bastos","description":"El Seis de Bastos está representado por el Heraldo (el enviado del rey), que trae al pueblo la noticia de la victoria. Al mismo tiempo, la carta simboliza la victoria, el éxito y, en general, las buenas noticias.","meaning":"Buenas noticias y perspectivas de éxito.","emotions":"Confías en el tema de la pregunta y crees que lograrás un resultado realmente bueno.","proposal":"La victoria te espera. Todo indica que tu negocio se desarrollará bien.","perspectives":"Estás en camino al éxito. Se acercan buenas noticias.","love":"En el amor y las relaciones - felicidad, buenas noticias, ganancia","profession":"En la profesión - logro del éxito, avance, buenas noticias, promoción.","generally":"En general - éxito, victoria, reconocimiento, regreso feliz."},{"id":29,"name":"Siete de Bastos","description":"Te Siete de Bastos indica que tú, tu posición o tu punto de vista están siendo atacados, pero tu defensa tendrá éxito.","meaning":"Presencia de una posición y defensa exitosa de la misma contra los atacantes.","emotions":"Crees que serás atacado y estás decidido a defender tu posición.","proposal":"Estate atento. Hay personas envidiosas y malvadas que son hostiles contigo y están preparando trucos. Pero tienes una buena oportunidad de derrotarlos.","perspectives":"Serás atacado, disputando algún resultado. Si te mantienes alerta y te defiendes con decisión, ganarás.","love":"En el amor y las relaciones - peleas, celos, amenazas.","profession":"En la profesión - la necesidad de defender la propia posición o punto de vista.","generally":"En general - la envidia y la mala voluntad de los demás, la necesidad de mantener la línea."},{"id":30,"name":"Ocho de Bastos","description":"El Ocho de Bastos indica que la situación está a punto de resolverse con éxito.","meaning":"Buenas noticias están en el aire y llegarán antes de lo esperado.","emotions":"Crees que el viento fresco de una nueva vida cambiará la situación y se desarrollará bien.","proposal":"Cree que pronto recibirás buenas noticias y lograrás un resultado significativo.","perspectives":"Te espera una agradable sorpresa. Se respiran buenas vibraciones y desarrollos favorables.","love":"En el amor y las relaciones - sorpresas agradables, momentos llenos de amor.","profession":"En profesión - un evento auspicioso llegará antes de lo esperado.","generally":"En general - hay buenas noticias en el aire."},{"id":31,"name":"Nueve de Bastos","description":"El Nueve de Bastos muestra que la persona está alerta y se siente amenazada incluso donde no existe. La carta también puede significar insularidad.","meaning":"Insularidad y confrontación, posiblemente también una amenaza.","emotions":"Te sientes amenazado por el tema, quieres retraerte y esconderte. Es posible que hayas hecho algo vergonzoso.","proposal":"Mantente alerta, incluso si el peligro aún no es visible. No dejes que nada ni nadie se acerque a ti.","perspectives":"Estarás parado frente a puertas cerradas, encontrarás resistencia, o probablemente serás tú quien decida quedarse solo.","love":"En el amor y las relaciones - miedo, sal en viejas heridas, confrontación dura.","profession":"En profesión - ser cauteloso o estar frente a puertas cerradas.","generally":"En general - sentirse amenazado, obligado a parar."},{"id":32,"name":"Diez de Bastos","description":"El Diez de Bastos muestra que una persona está sobrecargada de tareas, responsabilidades, pero posiblemente es capaz de crecer interiormente.","meaning":"Estás agobiado por perspectivas confusas y una gran carga de trabajo.","emotions":"Ves el tema como una gran carga, tienes miedo de que sea demasiado difícil para ti y no puedas alcanzar tu objetivo.","proposal":"Ármate con energía: la carrera de maratón está por delante. Sé valiente, cálmate y da el paso adelante, aunque te parezca difícil.","perspectives":"Tomará mucho esfuerzo de tu parte, casi hasta el límite de tu capacidad. Asume que realmente tienes que hacer todo solo y que no hay nadie a quien transferirle la responsabilidad.","love":"En amor y relaciones - pesimismo, altas exigencias, problema para llevarse bien con alguien.","profession":"En la profesión - sobrecarga, desperdicio de energía, hacer todo solo.","generally":"En general - perspectivas opresivas y poco claras."},{"id":33,"name":"Sota de Bastos","description":"La Sota de Bastos simboliza buenas oportunidades enérgicas e impulsos motivadores que vienen del exterior y serán recibidos con entusiasmo.","meaning":"Se presentan cuotas sobresalientes favorables.","emotions":"Ves reales, tal vez incluso \\"oportunidades importantes\\" en el tema que te inspira. Eres abierto, te permites ser motivado e incluso dejarte llevar.","proposal":"Espera y muéstrate abierto a la oportunidad que se te da y que te inspirará.","perspectives":"Confía en que encontrarás apoyo en el camino y recibirás un impulso motivado y apasionado de los demás.","love":"En el amor y las relaciones - un impulso refrescante, una propuesta maravillosa, una oportunidad dinámica.","profession":"En la profesión - desafío profesional, recompensa, oportunidad dinámica.","generally":"En general - un impulso real, una propuesta que inspira entusiasmo."},{"id":34,"name":"Caballero de Bastos","description":"El Caballero de Bastos simboliza un ambiente acalorado, una fase temperamental que trae impaciencia y sed de aventuras a la vida.","meaning":"Fase activa, atmósfera caliente y sed de riesgo.","emotions":"Eres impaciente y quieres todo a la vez.","proposal":"Sigue adelante recto, decidido e impaciente. Echa leña al fuego y aporta calor y dinamismo a tus intenciones.","perspectives":"Hay una fase dinámica, durante la cual sucederán muchas cosas. Será caliente y animado.","love":"En el amor y las relaciones - tiempos calurosos, sed de experiencias, pasión, aventura.","profession":"En la profesión - espíritu aventurero, espíritu emprendedor, impaciencia y un ambiente acalorado.","generally":"En general - sangre caliente, impaciencia, asunción de riesgos, aventura, clima cálido."},{"id":35,"name":"Reina de Bastos","description":"La Reina de Bastos representa a una mujer temperamental, segura de sí misma, activa e independiente.","meaning":"Soberanía y espíritu emprendedor, mujer decidida, segura de sí misma y muy motivada.","emotions":"Eres independiente y seguro de ti mismo, capaz de inspirarte rápidamente. Consideras el tema con benevolencia, lo tomas como algo personal, reaccionas rápidamente a la situación.","proposal":"Haz lo que quieras. Cree en tu coraje y tu fuerza. Mantente confiado. O acércate a una mujer que encarne estas cualidades.","perspectives":"Finalmente estás muy motivado, eres independiente y confiado. Tal vez este camino te lleve a la independencia. O conocerás a una mujer que encarna estas cualidades.","love":"En el amor y las relaciones - una mujer orgullosa, segura de sí misma y apasionada, una amazona, una compañera de lucha.","profession":"En profesión - segura de sí misma, marca la pauta, mujer independiente, jefa.","generally":"En general - una mujer temperamental, de voluntad fuerte, emprendedora, independiente."},{"id":36,"name":"Rey de Bastos","description":"El Rey de Bastos representa a un hombre temperamental, confiado y activo: explorador.","meaning":"Soberanía y espíritu emprendedor, hombre de voluntad fuerte, seguro de sí mismo y muy motivado.","emotions":"Actúas de forma independiente y con confianza en ti mismo, marcando el tono de forma voluntaria y enfatizando enfáticamente. Tratas el tema con amabilidad y favor, y reaccionas ante las situaciones rápidamente.","proposal":"Haz lo que quieras. Cree en tu coraje y fuerza. Muestra tu confianza. O acércate a un hombre que encarne estas cualidades.","perspectives":"Finalmente has encontrado motivación y confianza en ti mismo. Tal vez este camino te lleve a la independencia. O conocerás a un hombre que encarna estas cualidades.","love":"En el amor y las relaciones - un hombre orgulloso y seguro de sí mismo, un luchador independiente.","profession":"En la profesión - seguro de sí mismo, independiente, marca la pauta, hombre independiente, jefe.","generally":"En general - un hombre temperamental, de voluntad fuerte, activo, emprendedor."},{"id":37,"name":"As de Espadas","description":"A cada as se le da una oportunidad. El as de espadas brinda una buena oportunidad para comprender y aclarar algo, para tomar una decisión importante.","meaning":"Una oportunidad dada por el desarrollo de una situación. Implica un conocimiento importante y puede conducir a la realización de la verdad.","emotions":"Sabes que esta es una buena oportunidad para entender algo, aclarar y decidir algo que es importante para el tema.","proposal":"Presta atención a la oportunidad que tienes. Te ayudará a encontrar una decisión acertada, aclarar y comprender algo importante.","perspectives":"Algo importante te espera, ya sea tomar una decisión o saber la verdad. Este evento debería suceder pronto.","love":"En el amor y las relaciones - una sabia decisión, claridad de pensamientos, conversación abierta.","profession":"En la profesión - una buena oportunidad para obtener sabiduría o tomar una decisión importante.","generally":"En general - una oportunidad para comprender, aclarar, resolver algo."},{"id":38,"name":"Dos de Espadas","description":"El Dos de Espadas muestra dudas que pueden ser profundas y difíciles de resolver, ya que se bloquea el acceso a fuentes de autoconfianza interior.","meaning":"Skepsis, desconfianza, duda angustiosa, a veces también una situación frustrante.","emotions":"Estás frustrado con el tema y no sabes qué creer o qué hacer a continuación.","proposal":"Sé escéptico y no te dejes llevar por la luz. Tienes motivos para desconfiar y cuestionar todo.","perspectives":"Vendrán dudas que te resultarán difíciles de soportar. Dudarás de tu camino futuro, probablemente de tu curso de acción anterior.","love":"En el amor y las relaciones - dudas dolorosas, falta de confianza en una pareja.","profession":"En la profesión - dudas profundas, lanzando en diferentes direcciones.","generally":"En general - dudas obstinadas, indecisión y desesperación."},{"id":39,"name":"Tres de Espadas","description":"El Tres de Espadas simboliza experiencias dolorosas y decisiones que son desafortunadas, pero no obstante correctas y necesarias.","meaning":"Sobrio, decepción, paso doloroso, sentimientos profundos, dolor de corazón, corazón roto.","emotions":"Estás sobrio y frustrado y sabes que el tema requiere que des un paso necesario pero incómodo, quizás incluso doloroso.","proposal":"Asume sobria y claramente lo que es razonable para ti ahora. Da este paso con decisión, incluso si es duro o doloroso.","perspectives":"Tu camino te lleva a la desilusión, a una decisión desagradable o dolorosa, o a consecuencias desagradables.","love":"En el amor y las relaciones - recuperación de la sobriedad, decepción, mal de amores, lágrimas.","profession":"En la profesión - información aleccionadora, críticas, decisiones difíciles pero necesarias, rechazo.","generally":"En general - experiencias dolorosas, decisiones difíciles pero razonables, rechazo."},{"id":40,"name":"Cuatro de Espadas","description":"El Cuatro de Espadas significa un estado de estancamiento, debilidad y una pausa forzada en la que una persona está inactiva, como en tiempos de enfermedad y desempleo.","meaning":"Cosas que están congeladas, sensación de debilidad, incapaz de hacer nada.","emotions":"Ves que el tema está estancado y tú mismo estás inactivo o incluso completamente incapaz de tomar ninguna acción.","proposal":"Deja las cosas a un lado. No puedes hacer nada en este momento y no debes forzarte a hacerlo. Usa la pausa forzada para descansar y recuperar tu fuerza.","perspectives":"Este camino lleva al estancamiento. Si lo sigues, necesitarás mucha paciencia y ecuanimidad.","love":"En el amor y las relaciones - estancamiento, aislamiento, pérdida de interés por una pareja.","profession":"En la profesión - debilidad, desempleo, proyectos retrasados.","generally":"En general - pausa forzada, enfermedad, aislamiento, actividad reprimida."},{"id":41,"name":"Cinco de Espadas","description":"El Cinco de Espadas muestra una lucha con grandes pérdidas, en la que al final solo hay perdedores. Porque incluso el supuesto ganador se da cuenta de que la victoria tuvo un precio demasiado alto.","meaning":"La mezquindad y la bajeza, el odio muy fuerte y el peligro de la derrota.","emotions":"Eres hostil al tema. Aceptas la mezquindad y la ruina, pero crees que las cosas pueden cambiar. Entiendes que la victoria puede lograrse a un precio muy alto.","proposal":"Hay un conflicto del que no puedes escapar. Muestra los dientes y lucha con todos los medios a tu alcance.","perspectives":"Este camino lleva a una crisis severa, una lucha que consumirá muchos recursos. Si eliges este camino, debes ser consciente de que la victoria puede tener un alto costo.","love":"En el amor y las relaciones - crueldad, desacuerdos, conflictos, engaños.","profession":"En la profesión - mezquindad, ansiedad, desacuerdo, colapso.","generally":"En general - incluso si logras lograr la victoria, es poco probable que te sientas como un ganador."},{"id":42,"name":"Seis de Espadas","description":"El Seis de Espadas simboliza los cambios que nos llevan a nuevas costas. Sin embargo, el estado de ánimo expresado por la carta muestra que los cambios pueden causarnos sentimientos ambivalentes, a veces desagradables.","meaning":"Una partida que avanza lentamente, una fase de cambio que puede estar asociada con la inseguridad del puesto, la emoción de una nueva experiencia de vida.","emotions":"Te sientes ajeno al tema de la pregunta y lo abordas con \\"piernas de algodón\\".","proposal":"Adelante. Deja el modo de vida habitual y emprende un viaje pausado hacia lo nuevo y diferente. Si te sientes inseguro, busca ayuda profesional.","perspectives":"Cambiarás las reglas del juego y te dirigirás a nuevas costas. Pero incluso si te sientes incómodo al respecto, aún no se trata del peligro real que te amenaza. Necesitas tiempo para acostumbrarte a lo nuevo circunstancias.","love":"En el amor y las relaciones - liberación de viejas relaciones, deseo de nuevas relaciones pero al mismo tiempo, miedo a los cambios.","profession":"En la profesión - cambios, comienzos frágiles y poco confiables.","generally":"En general - partida acompañada de una sensación de inseguridad, cambio, reasentamiento."},{"id":43,"name":"Siete de Espadas","description":"El Siete de Espadas muestra que una mente aguda puede convertirse en engaño y, en algunos casos controvertidos, en astucia.","meaning":"Falta de sinceridad, alguien utiliza cualquier medio para engañar y sustituir conceptos, o alguien se hace lo mismo a sí mismo.","emotions":"Estás listo para usar todos los activos disponibles y puedes lograr tu objetivo mediante el engaño y la astucia.","proposal":"Aborda el asunto artísticamente. Demuestra que has pasado por el fuego y el agua y que puedes engañar, engañar y ser astuto fácilmente. El caso puede requerir mucho ingenio, tal vez la capacidad de engañar, embellecer algunas cosas y mantener otras tranquilo.","perspectives":"Esté atento. Aquí es donde entra en juego la falta de sinceridad. Preste atención a lo que sucede \\"debajo de la mesa\\". Verifique también sus propios objetivos y motivos.","love":"En el amor y las relaciones - falta de sinceridad, evitación de conversaciones directas, engaño, alienación.","profession":"En profesión - intrigas, inocencia engañada, astucia, traición.","generally":"En general - astucia y engaño, evasión de obligaciones, fraude, autoengaño."},{"id":44,"name":"Ocho de Espadas","description":"El Ocho de Espadas muestra que una parte importante de nuestra naturaleza está actualmente inactiva. La esclavitud puede indicar prohibiciones y restricciones externas, o autocontrol y timidez. A veces se trata de la necesidad de recuperar la compostura y la autodisciplina.","meaning":"Restricciones. Si no se imponen voluntariamente (por ejemplo, el ayuno), entonces la tarjeta refleja esos obstáculos y prohibiciones que deberían ayudar a revivir un lado importante de una personalidad.","emotions":"O tomarás las riendas de ti mismo para lograr el objetivo previsto, o llegarás a la conclusión de que el desarrollo del tema se ve obstaculizado por prohibiciones externas y, por lo tanto, no es viable.","proposal":"Abróchate el cinturón. Recupérate. Obviamente, vale la pena renunciar a algo por un tiempo para lograr un resultado significativo.","perspectives":"Este camino te ha llevado a una situación difícil. Durante mucho tiempo, no podrás encontrar una salida.","love":"En el amor y las relaciones - hay obstáculos, limitaciones, un control de las circunstancias.","profession":"En profesión - fuertes restricciones, inconsistencia, situación insoportable prolongada.","generally":"En general - obstáculos, fracaso, esfuerzos infructuosos, imposibilidad de acción."},{"id":45,"name":"Nueve de Espadas","description":"El Nueve de Espadas simboliza noches de insomnio, pesadillas, así como remordimientos y remordimientos de conciencia.","meaning":"Miedo, preocupaciones o mala conciencia.","emotions":"Tienes miedo del tema o te arrepientes de tus acciones.","proposal":"Da un paso que temes, y si tienes mala conciencia, muestra tu remordimiento.","perspectives":"La tristeza, el remordimiento y la decepción te esperan en este camino. Quizás deberías renunciar a lo que has planeado, para no arrepentirte después.","love":"En el amor y las relaciones - preocupaciones, remordimientos, dudas, tristeza.","profession":"En la profesión - noches de insomnio, miedos, remordimientos.","generally":"En general - miedo, remordimiento, pesadillas, desesperación."},{"id":46,"name":"Diez de Espadas","description":"El Diez de Espadas significa el final de algo. Puede ser un final triste, una derrota, un fracaso, una traición, un sentimiento de víctima.","meaning":"Derrota, terminación de algo, un paso radical hacia la terminación.","emotions":"Te sientes abrumado, deprimido, derrotado.","proposal":"Deja este asunto. Termínalo y olvídalo.","perspectives":"Todo está llegando a su fin. Este tema no tiene futuro.","love":"En el amor y las relaciones - fin de las relaciones, terminación de las relaciones.","profession":"En la profesión - terminación del trabajo, fin forzoso, fracaso, despido.","generally":"En general - final forzado, finalización de algo, fracaso, derrota."},{"id":47,"name":"Sota de Espadas","description":"La Sota de Espadas simboliza impulsos críticos y razonados que vienen del exterior, que a menudo pueden percibirse como ataques.","meaning":"Una oportunidad de aclarar las cosas por ti mismo, pero también el riesgo de ser criticado y acosado.","emotions":"Ves algún tipo de conflicto en el tema y te sientes amenazado. En el caso correcto, estás listo para exponerte a las flechas de la crítica.","proposal":"Tolera las críticas y sé lo más abierto posible. Si prestas atención, obtendrás nuevas ideas de esta situación u otro punto de vista, y aprenderás muchas cosas útiles.","perspectives":"Sopla una brisa fresca en el camino que, a primera vista, puede parecer hostil. Prepárate para las críticas.","love":"En el amor y las relaciones - una amenaza, una crisis, una pelea, un enfrentamiento.","profession":"En la profesión - críticas, intercambio de comentarios, molestia, pero al mismo tiempo, posibilidades de aclarar algo.","generally":"En general - ser criticado, avivar el conflicto, tener la oportunidad de volverse más sabio después de escuchar las críticas."},{"id":48,"name":"Caballero de Espadas","description":"El Caballero de Espadas simboliza una atmósfera fría o incluso gélida, un estado de ánimo en el que fácilmente surgen disputas y fuertes confrontaciones. Solo en casos excepcionales los conflictos conducen a la comprensión y clarificación de la situación.","meaning":"Fase conflictiva, atmósfera gélida y clima hostil donde es fácil arremeter y pelear.","emotions":"Eres hostil al tema y lo ves como un conflicto.","proposal":"Sé crítico, frío y resuelto. Muestra tus dientes y lucha si la situación lo vale.","perspectives":"Estás en una fase de tu vida en la que se está gestando el conflicto. Puede ser muy violento y hostil. Pero quizás te enriquezca con algún conocimiento importante.","love":"En el amor y las relaciones - frialdad, crisis, arrogancia, travesuras rencorosas.","profession":"En la profesión - hay peleas, conflictos, la tentación de desquitarse con alguien.","generally":"En general - agresividad, mal genio, conflicto."},{"id":49,"name":"Reina de Espadas","description":"La Reina de Espadas representa a una mujer independiente, segura de sí misma, inteligente y serena.","meaning":"Claridad e independencia, o una mujer de mente aguda, independiente y probablemente también fría.","emotions":"Estás interesado y abierto. Abordas el tema con una mente aguda y quieres obtener una solución clara.","proposal":"Confía en tu inteligencia y claridad de pensamiento. Demuestra tu criticidad e interés. O acércate a una mujer que encarne estas cualidades.","perspectives":"Tomas una posición clara y razonable. Tu camino conduce a una solución clara, o conocerás a una mujer que encarna cualidades tales como una mente aguda, claridad de pensamientos.","love":"En el amor y las relaciones - una mujer encantadora pero fría, coqueta y casual, pero también capaz de mantener las distancias.","profession":"En profesión - una mujer independiente, inteligente y fría, una experta con conocimientos, una profesional independiente.","generally":"En general - una mujer elegante, fría, ingeniosa, ágil, elocuente, inteligente, calculadora."},{"id":50,"name":"Rey de Espadas","description":"El Rey de Espadas simboliza a un hombre inteligente, comunicativo, frío e inteligente.","meaning":"Posición inteligente y clarividente, u hombre bien informado, independiente y espiritualmente rico.","emotions":"Eres interesado, comunicativo y mantienes una sana distancia con los demás. Sopesas argumentos, piensas y te formas tus propias opiniones.","proposal":"Confía en tu agilidad y en la riqueza de tus ideas. Demuestra tu criticidad y encuentra la solución adecuada. O contacta a un hombre que encarne estas cualidades.","perspectives":"Te sientes libre e independiente y adoptas una postura soberana y sabia. Quizás tu camino te lleve a la independencia. O conocerás a un hombre que encarna estas cualidades.","love":"En el amor y las relaciones - un hombre encantador pero frío, encantador e informal, capaz de mantener las distancias, quisquilloso.","profession":"En profesión - un hombre inteligente y frío, un experto informado, un profesional independiente.","generally":"En general - un hombre fuerte y frío, ingenioso, ágil, elocuente y calculador."},{"id":51,"name":"As de Copas","description":"Cada As tiene una oportunidad. El As de Copas da la oportunidad de encontrar la felicidad, la paz, el amor y la satisfacción.","meaning":"Esta es una buena oportunidad que tienes. Si la aprovechas, encontrarás felicidad y satisfacción.","emotions":"Ves el tema como una oportunidad para encontrar la felicidad, la comprensión y el amor, o para conseguir algo que realmente deseas.","proposal":"Date cuenta de que tienes una oportunidad única. Ahora es tu oportunidad de encontrar tu vocación, tu gran amor o lo que más desees.","perspectives":"Buenas noticias te esperan. Tienes la oportunidad de encontrar el amor, la paz y la alegría.","love":"En el amor y las relaciones - un gran amor y tiempos felices están a la vuelta de la esquina.","profession":"En la profesión - una oportunidad de seguir tu vocación y encontrar satisfacción en ella.","generally":"En general - una oportunidad de encontrar la felicidad y una profunda satisfacción."},{"id":52,"name":"Dos de Copas","description":"El Dos de Copas simboliza una cálida bienvenida, reconciliación y conexión.","meaning":"Comunidad, amor, comprensión mutua o cualquier otra unión.","emotions":"Tienes una actitud positiva hacia el tema y estás dispuesto a dar un paso voluntariamente hacia personas o situaciones.","proposal":"Sé conciliador y coopera con la gente. Ve hacia los demás y forma una alianza con alguien.","perspectives":"Recorrerás tu camino no solo, sino en alianza con alguien. Una alianza de amor o cooperación; de cualquier manera, es una relación agradable.","love":"En el amor y las relaciones - enamorarse, reconciliarse, hacer algo juntos.","profession":"En profesión - unir, cooperar, desear.","generally":"En general - una cálida bienvenida, un paso hacia el otro, hacer las paces."},{"id":53,"name":"Tres de Copas","description":"El Tres de Copas significa que se ha logrado el éxito y, por lo tanto, va acompañado de felicidad, gratitud y satisfacción.","meaning":"Logro de algo bueno, alegría y gratitud.","emotions":"Eres muy positivo sobre el tema. Realmente aprecias lo que has logrado y te sientes agradecido.","proposal":"Sé agradecido por lo que has recibido y comparte tu alegría con los que te rodean.","perspectives":"Estarás feliz, satisfecho y agradecido por lo que logras y recibes.","love":"En el amor y las relaciones - gran felicidad y gratitud, matrimonio, maternidad.","profession":"En la profesión - la alegría de un buen trato y un paso exitoso.","generally":"En general - éxito y gratitud, recuperación, la oportunidad de compartir tu alegría con los demás."},{"id":54,"name":"Cuatro de Copas","description":"El Cuatro de Copas muestra una sobresaturación de lo que hasta hace poco se percibía como una fuente de alegría. También advierte contra los placeres dudosos.","meaning":"Enfado, decepción, sentirse ofendido.","emotions":"Estás aburrido, harto del tema y cansado de él.","proposal":"Si te sientes herido y molesto, o simplemente cansado de todo, tómate un momento de reclusión. No vuelvas a una situación que te moleste o te agote, o la oportunidad que se te presente no parecerá bienvenida.","perspectives":"La frustración y la decepción te esperan en el camino, causadas por el aburrimiento o el agotamiento emocional. Si sigues por este camino, debes vigilar tus cambios de humor y tener mucho cuidado. Entonces no perderás tu oportunidad.","love":"En el amor y las relaciones - letargo de los sentimientos, sobresaturación.","profession":"En la profesión - irritación, agotamiento emocional, cansancio.","generally":"En general - disgusto, profundo resentimiento, una valiosa oportunidad perdida por estar aburrido, cansado, harto de algo."},{"id":55,"name":"Cinco de Copas","description":"El Cinco de Copas muestra tristeza y dolor por lo que ha fallado.","meaning":"Desilusión, pena o triste despedida.","emotions":"El tema te entristece. Estás decepcionado porque fallaste en algo que significaba mucho para ti.","proposal":"La tristeza te espera en este camino. Si es posible, no vayas por ese camino.","perspectives":"Este camino lleva a la decepción. Puedes fallar.","love":"En el amor y las relaciones - mal de amores, desilusión, pérdida de una pareja, soledad.","profession":"En la profesión - pérdidas, decepciones graves, tiempos difíciles, colapso de las ambiciones.","generally":"En general - tristeza, pérdida, abandono, esperanzas frustradas."},{"id":56,"name":"Seis de Copas","description":"El Seis de Copas simboliza recuerdos sin nubes, encuentros con personas del pasado, un regreso a viejos comienzos.","meaning":"Una actividad que hiciste antes. Ahora es el momento de volver a hacerlo.","emotions":"Tienes buenos recuerdos del tema y tienes la intención de hacerlo de nuevo.","proposal":"Piensa en lo que querías antes y comprueba si todavía hay potencial para el desarrollo del tema.","perspectives":"Este camino te resulta muy familiar, parece que ya lo has recorrido alguna vez. Tal vez, al recorrerlo, te encuentres con personas que solían ser queridas. En cualquier caso, te inspirará maravillosos recuerdos.","love":"En el amor y las relaciones - para conocer viejos amores, recordar tiempos pasados, enamorarse, revivir viejos buenos recuerdos.","profession":"En la profesión - recuerda objetivos pasados, viejos contactos que resultan útiles.","generally":"En general - ayuda del pasado, para recordar viejos deseos, planes, sueños, buenos recuerdos."},{"id":57,"name":"Siete de Copas","description":"El Siete de Copas en casos raros representa visiones místicas. La mayoría de las veces, simboliza una ilusión que tarde o temprano conducirá al engaño.","meaning":"Esto es una ilusión. Lo más probable es que tus expectativas exploten como pompas de jabón.","emotions":"Estás fascinado con el tema de la pregunta y lo estás mirando a través de lentes color de rosa. En cualquier caso, por ahora no eres capaz de ver las circunstancias con seriedad.","proposal":"Ten cuidado. Lo más probable es que no evalúes la situación con seriedad y tiendes a tener grandes expectativas. Como resultado, es posible que este camino no te lleve a lo que esperas.","perspectives":"Este camino lleva a la ilusión. Obtendrás una idea falsa sobre el tema, serás engañado.","love":"En el amor y las relaciones - enamorarse, embriagarse, soñar despierto.","profession":"En la profesión - peligro de engaño e intriga, engaño.","generally":"En general - visiones, ilusiones, soñar despierto, ilusiones."},{"id":58,"name":"Ocho de Copas","description":"El Ocho de Copas simboliza una partida voluntaria. Pero la empresa no es fácil para ti. Separarte de tu estilo de vida habitual es difícil, y ahora es imposible predecir cómo resultará todo en el futuro.","meaning":"Adiós a algún tema o etapa de la vida, partida hacia lo desconocido.","emotions":"Estás en el proceso de abandonar tu estilo de vida actual y dirigirte a uno nuevo que parece desconocido y desafiante.","proposal":"Es hora de salir a la carretera. Incluso si cada paso es difícil para ti, esfuérzate.","perspectives":"Dejarás tu camino familiar y te dirigirás a una nueva dirección, a pesar de todas las probabilidades.","love":"En el amor y las relaciones - sigue tu propio camino, separación, desconexión.","profession":"En profesión - dejar el entorno familiar, ir hacia un futuro desconocido.","generally":"En general - partir con el corazón apesadumbrado, un viaje a lo desconocido, una partida voluntaria."},{"id":59,"name":"Nueve de Copas","description":"El Nueve de Copas simboliza una satisfacción bien merecida. Representa la hospitalidad y la alegría de estar con gente agradable.","meaning":"Un tiempo maravilloso, celebración, diversión.","emotions":"El tema trae alegría y quieres disfrutar de un buen rato, celebrar algo o reuniones con amigos.","proposal":"Inicia una fiesta o tómate un descanso y pasa tiempo con amigos u otras personas que te gusten.","perspectives":"De hecho, la estás pasando muy bien. Podrás disfrutar pasar tiempo con gente agradable mientras cosechas las recompensas de tus esfuerzos.","love":"En el amor y las relaciones - un sentimiento de felicidad, calidez, amistad profunda.","profession":"En la profesión - la colegialidad, el espíritu de solidaridad, un motivo de celebración.","generally":"En general - alegría, celebración, despreocupación, relajación, sociabilidad."},{"id":60,"name":"Diez de Copas","description":"El Diez de Copas representa felicidad, armonía y satisfacción. Muestra que nos sentimos bien, estando en un ambiente de apoyo, ya sea familia, amigos o compañeros de trabajo.","meaning":"Hogar, comunidad de amigos, fortalecimiento de alianzas.","emotions":"Estás interesado en el tema, listo para trabajar juntos y fortalecer las alianzas.","proposal":"Colabora con la gente, sintonízate para el trabajo en equipo o el ocio juntos.","perspectives":"Disfrutarás trabajando o alquilando con la gente que te gusta y tal vez incluso encuentres un hogar.","love":"En el amor y las relaciones - nuevas amistades, tiempos felices, matrimonio, familia.","profession":"En la profesión - un clima de trabajo favorable, trabajo en equipo agradable, fiesta corporativa.","generally":"En general - gran felicidad, profunda armonía, felicidad conyugal, seguridad emocional."},{"id":61,"name":"Sota de Copas","description":"La Sota de Copas simboliza un impulso pacífico, amistoso, que viene de afuera y que nos vamos a encontrar.","meaning":"Una oportunidad de encontrar la felicidad y el amor, pero también un apoyo benévolo, un favor o una oferta de amistad.","emotions":"Ves una oportunidad en el tema y estás abierto a cualquier gesto o sugerencia pacífica y amistosa.","proposal":"Demuestra que estás listo para preocuparte por alguien, ofrecerte amistad y no hacerte esperar.","perspectives":"Cree que encontrarás apoyo espiritual y comprensión, y que otras personas estarán dispuestas a ayudarte.","love":"En el amor y las relaciones - un gesto benévolo y conciliador, una propuesta de matrimonio, una oportunidad de enamorarse.","profession":"En la profesión - apoyo amistoso, una buena oferta.","generally":"En general - amabilidad con el que pregunta, un gesto amistoso, adulación."},{"id":62,"name":"Caballero de Copas","description":"El Caballero de Copas simboliza una atmósfera amistosa y cálida, un estado de ánimo armonioso de paz y amor.","meaning":"Escenario agradable y armonioso, atmósfera relajada y estado de ánimo primaveral.","emotions":"Te apasiona el tema y buscas tu solución armoniosa.","proposal":"Sigue adelante con una actitud positiva. Crea un ambiente agradable y cuida a tus amigos.","perspectives":"Estás en una fase pacífica, en una atmósfera de bienestar y benevolencia. La situación se desarrolla armoniosamente, puedes enamorarte.","love":"En el amor y las relaciones - enamoramiento, armonía, sentimientos primaverales, momentos felices.","profession":"En la profesión - un clima de trabajo armonioso, buen humor.","generally":"En general - un ambiente amistoso, próspero, conciliador, armonía y amor."},{"id":63,"name":"Reina de Copas","description":"La Reina de Copas personifica a una mujer justa encantadora, sensible, comprensiva y de sentimientos profundos que vive en el mundo de sus sueños.","meaning":"Intuición, fidelidad, sensibilidad y capacidad de adivinación, o mujer benévola, compasiva, justa.","emotions":"Estás abierto a los impulsos, pero te mantienes fiel a tus sentimientos. Abordas el tema con total comprensión y confías en tu intuición mientras lo haces.","proposal":"Confía en tu intuición y buenos instintos. Demuestra a quienes te rodean tu compasión y comprensión, tu voluntad de ayudar. O contacta a una mujer que personifique tales cualidades.","perspectives":"Experimentarás satisfacción y armonía, porque tus sentimientos son puros. O conocerás a una mujer que siente profundamente, es justa y llena de comprensión.","love":"En el amor y las relaciones - una mujer gentil, amable, sensible, romántica, a veces soñadora.","profession":"En profesión - mujer creativa e intuitiva, lista para ayudar, con un estilo desarrollado, artista.","generally":"En general - una mujer receptiva, suave, sensual, cariñosa, justa, con sentimientos profundos."},{"id":64,"name":"Rey de Copas","description":"El Rey de Copas representa a un hombre encantador, instintivo y profundamente sensible.","meaning":"Una expresión de sentimiento o habilidad artística, así como un hombre comprensivo y de sentimientos profundos.","emotions":"Eres atento y te involucras emocionalmente en el tema. Buscas expresar tus sentimientos.","proposal":"Confía en tu intuición e instintos. Muéstrate comprensivo, amistoso y benévolo. O acércate a un hombre que encarne estas cualidades.","perspectives":"Es hora de expresar lo que hay en tu corazón. Alternativamente, habla con un hombre que conozcas por su sensibilidad y benevolencia.","love":"En el amor y las relaciones - un hombre suave, amable, de sentimientos profundos, romántico y un poco soñador.","profession":"En profesión - persona estética, intuitiva, servicial, instintiva, artista.","generally":"En general - un hombre receptivo, manso, afectuoso, justo, sensual y de sentimientos profundos."},{"id":65,"name":"As de Pentáculos","description":"Cada As tiene una oportunidad. El As de Pentáculos tiene la oportunidad de lograr un éxito tangible, obtener resultados significativos, encontrar una felicidad duradera o simplemente ganar mucho dinero.","meaning":"Se te ha dado una buena oportunidad con un gran potencial de crecimiento. Obtendrás un valor duradero, o puede ayudarte a encontrar riqueza material o espiritual.","emotions":"Ves una gran oportunidad frente a ti que te llevará a resultados significativos o a un buen negocio.","proposal":"Date cuenta de que tienes una excelente oportunidad. Ahora tienes la oportunidad de crear algo de valor material, construir algo sólido o ganar mucho dinero.","perspectives":"Te espera una gran oportunidad, que definitivamente deberías aprovechar. Si te pones manos a la obra correctamente, puedes obtener un resultado significativo.","love":"En el amor y las relaciones - la felicidad y el bienestar están notablemente cerca.","profession":"En la profesión - una buena oportunidad para obtener éxito, perspectivas sólidas, promoción, victoria o ganar una cantidad significativa de dinero.","generally":"En general - una buena y sólida posibilidad de riqueza material o espiritual."},{"id":66,"name":"Dos de Pentáculos","description":"El Dos de Pentáculos muestra flexibilidad, el arte de jugar con las posibilidades.","meaning":"Intento de broma, desafío fácil, preguntas que requieren flexibilidad.","emotions":"Eres flexible sobre el tema y estás dispuesto a probar todas las posibilidades, adaptándote a la situación, trátala con ánimo lúdico.","proposal":"Aborda el tema de forma divertida y poco convencional. No tomes decisiones precipitadas. Intenta hacer lo que quieras.","perspectives":"Te mostrarás flexible pero no decidido, sopesando diferentes opciones para tomar la mejor decisión.","love":"En el amor y las relaciones - despreocupado, juguetón, indeciso.","profession":"En la profesión - un juego con posibilidades, demostración de flexibilidad, mantenerse al día con la tendencia general.","generally":"En general - flexibilidad, vacilación juguetona, frivolidad."},{"id":67,"name":"Tres de Pentáculos","description":"El Tres de Pentáculos simboliza un examen que se aprobará y se abrirá el acceso a tareas más complicadas e importantes.","meaning":"Aprobar un examen o alcanzar un nivel superior de resolución de problemas.","emotions":"Eres positivo sobre el tema. Sabes que se trata de progreso y desarrollo de habilidades, eso te ayudará a pasar a un nivel superior.","proposal":"Hazte un examen o encárgate de conquistar nuevas alturas. Deja las viejas formas de actuar, sé una persona madura.","perspectives":"Tienes un examen o prueba que probablemente aprobarás.","love":"En el amor y las relaciones - probar sentimientos, superar barreras, ganar estabilidad.","profession":"En la profesión - demostración de las habilidades de uno, mejora de las habilidades para tareas más complejas, promoción.","generally":"En general - un progreso, aprobar un examen, alcanzar un nuevo nivel."},{"id":68,"name":"Cuatro de Pentáculos","description":"El Cuatro de Pentáculos muestra que tratar de aferrarse a las posesiones materiales resulta en inmovilidad.","meaning":"Prevención de riesgos, algún valor del que uno quiere estar absolutamente seguro.","emotions":"Eres demasiado cauteloso, no actúas porque tienes miedo de perder algo.","proposal":"No te arriesgues. Ten especial cuidado con el tema. No le prestes dinero a nadie.","perspectives":"Tienes un camino difícil por delante. Tendrás muchas dudas que te impiden avanzar.","love":"En el amor y las relaciones - aferrarse a alguien, instinto posesivo, correr en círculos.","profession":"En la profesión - avaricia, instinto posesivo, mayor necesidad de seguridad.","generally":"En general - debilidad, miedo de perder algo."},{"id":69,"name":"Cinco de Pentáculos","description":"El Cinco de Pentáculos simboliza la pobreza, la inseguridad y la necesidad. La carta puede indicar dificultades financieras o problemas en áreas que se encuentran en terreno inestable.","meaning":"Un período difícil, pobreza, algo que no es confiable y frágil.","emotions":"Te sientes inseguro sobre el tema o se siente como una gran carga financiera para ti.","proposal":"Intenta reducir tus gastos, la pregunta del tema requiere muchos recursos de tu parte.","perspectives":"Estás en un terreno poco confiable. Hay un tramo de camino por delante que te hará sentir inseguro, hambriento o desamparado.","love":"En el amor y las relaciones - sentimientos de abandono, inseguridad, resentimientos, dificultades.","profession":"En la profesión - incertidumbre, necesidad, tiempos difíciles, período sin éxito económico.","generally":"En general - una crisis, una necesidad, terreno precario, pobreza, zona de riesgo."},{"id":70,"name":"Seis de Pentáculos","description":"El Seis de Pentáculos simboliza el equilibrio, la generosidad y la aceptación de un regalo. También indica que recibiremos apoyo, un regalo o que algunos de nuestros esfuerzos valdrán la pena.","meaning":"Un generoso dar y recibir este regalo. Ayuda externa, algo que valdrá la pena.","emotions":"Eres generoso con el tema y siempre estás dispuesto a ayudar. O eres el que está dispuesto a aceptar ayuda.","proposal":"Sé generoso y ven a ayudar a quien lo necesite, o acepta ayuda si tú mismo la necesitas.","perspectives":"Esta empresa se amortizará sola, recibirás ayuda y apoyo, y probablemente también puedas ayudar a alguien.","love":"En el amor y las relaciones - generosidad, comprensión, tolerancia, benevolencia, capacidad de dar y recibir.","profession":"En la profesión - ayuda significativa, apoyo, recompensa, recibir aliento.","generally":"En general - generosidad, capacidad para dar y recibir regalos, tolerancia, voluntad de ayudar."},{"id":71,"name":"Siete de Pentáculos","description":"El Siete de Pentáculos muestra que las cosas irán bien si se les da suficiente tiempo para hacerlo. La carta no dice si el interrogador es lo suficientemente paciente o si comenzará a cosechar prematuramente.","meaning":"Una prueba de paciencia. Si estás dispuesto a esperar lo suficiente para que llegue el resultado, todo saldrá bien.","emotions":"Tienes paciencia y perseverancia. Sabes que al final todo saldrá bien.","proposal":"Ocúpate de la situación y dale tiempo suficiente para que se desarrolle por completo. Solo tu impaciencia puede arruinar un resultado favorable.","perspectives":"Si le das al tema el tiempo suficiente para desarrollarlo, será de gran ayuda.","love":"En el amor y las relaciones - estabilidad y crecimiento, embarazo.","profession":"En la profesión - una prueba de paciencia, frutos que maduran lentamente.","generally":"En general - paciencia, crecimiento lento pero constante, tiempo de maduración."},{"id":72,"name":"Ocho de Pentáculos","description":"El Ocho de Pentáculos significa que uno ha comenzado un importante que durará mucho tiempo y se desarrollará.","meaning":"Una empresa prometedora, un tema que puede y debe desarrollarse.","emotions":"Ves que estás al comienzo del proceso y listo para comenzar poco a poco. Crees en el desarrollo exitoso del tema.","proposal":"Ingresa a este camino. Comienza lo que has planeado, pero no sobreestimes tus habilidades. Todavía tienes mucho que aprender y practicar, entonces todo saldrá bien.","perspectives":"En este camino, llegarás a una nueva empresa que, gracias a tu actividad, puede conducir a resultados realmente sobresalientes, a menos que sobreestimes tus capacidades.","love":"En el amor y las relaciones - un nuevo comienzo, un nuevo impulso, un movimiento continuo hacia adelante.","profession":"En la profesión - tareas nuevas, prometedoras a largo plazo, una fase constructiva.","generally":"En general - un comienzo, un nuevo aprendizaje, una empresa bien pensada."},{"id":73,"name":"Nueve de Pentáculos","description":"El Nueve de Pentáculos simboliza un buen momento y la posibilidad de una gran victoria.","meaning":"Conjunto de circunstancias favorables, posibilidad de una gran victoria.","emotions":"Ves tu oportunidad de ganar.","proposal":"La felicidad está de tu lado. Aprovecha la oportunidad y aprovéchala al máximo.","perspectives":"Te espera una buena oportunidad, un feliz giro de los acontecimientos, una gran victoria. Te sentirás espiritual o materialmente enriquecido.","love":"En el amor y las relaciones - felicidad y amor, asombro gozoso.","profession":"En profesión - felicidad, suerte, buena oportunidad, recompensa monetaria.","generally":"En general - un momento feliz, una ganancia, una mejora repentina."},{"id":74,"name":"Diez de Pentáculos","description":"El Diez de Pentáculos simboliza confiabilidad, abundancia, riqueza. También puede significar una gran riqueza espiritual que se puede obtener.","meaning":"Seguridad, riqueza y estabilidad. Puede ser una indicación de que se debe descubrir una riqueza oculta.","emotions":"Sabes que el tema es un verdadero tesoro y lo ves como una gran riqueza a alcanzar.","proposal":"Evalúa la importancia de las oportunidades que se han abierto y presta atención a lo que ahora te parece secundario.","perspectives":"Estas entrando en una fase de vida segura y estable y puede adquirir o aumentar su riqueza.","love":"En el amor y las relaciones - estabilidad, felicidad familiar, encontrar un hogar.","profession":"En profesión - un trabajo seguro, buenas ofertas, satisfacción.","generally":"En general - riqueza, confiabilidad, éxito, una base sólida."},{"id":75,"name":"Sota de Pentáculos","description":"La Sota de Pentáculos representa un impulso valioso y confiable que proviene del exterior y brinda una oportunidad de enriquecimiento.","meaning":"Una oportunidad de tener éxito, ganar dinero, posiblemente apoyo financiero o una oferta seria.","emotions":"Ves una oportunidad real y valiosa para ti en el tema y estás abierto a discutir una propuesta seria o un proyecto específico.","proposal":"Espera y acepta una oferta seria, ábrete a la sólida oportunidad que aparece en tu camino.","perspectives":"Cree que a lo largo del camino que ha elegido, recibirá un apoyo valioso o tendrá la oportunidad de ganar dinero.","love":"En el amor y las relaciones - un encuentro que te enriquecerá, un generoso gesto de pareja.","profession":"En profesión - un trabajo rentable, una oferta sólida, una buena oportunidad de ganar dinero.","generally":"En general - una sugerencia sólida, una buena oportunidad de ganar dinero o volverse espiritualmente más rico."},{"id":76,"name":"Caballero de Pentáculos","description":"El Caballero de Pentáculos simboliza un clima estable, una atmósfera de seguridad en la que se puede trabajar productivamente y obtener buenos resultados.","meaning":"Fase estable, entorno sólido, estado de ánimo en el que se disfruta del trabajo.","emotions":"Ves un valor en el tema, considéralo confiable y sólido.","proposal":"Sigue adelante con perseverancia y resistencia. Crea una atmósfera de estabilidad a tu alrededor y ten cuidado de traer constantemente algo de valor y sustancia a la vida.","perspectives":"Esta es una fase estable en la que te sentirás confiado. Si quieres lograr el éxito o construir algo de valor, ahora es el momento de ser enérgico y activo.","love":"En el amor y las relaciones - relaciones estables, tranquilas y de confianza.","profession":"En la profesión - una base saludable, trabajo duro, entorno sólido, seguridad.","generally":"En general - una atmósfera sólida y feliz, un clima de constancia, pero también de terquedad."},{"id":77,"name":"Reina de Pentáculos","description":"La Reina de Pentáculos se presenta como una mujer confiable, hábil y diligente, que maneja concienzudamente los valores que posee y los que le son confiados.","meaning":"Preservación de valores, fertilidad o una mujer confiable y sensual que se mantiene firme sobre sus pies.","emotions":"Eres comprensivo con el tema, realista y dispuesto a ganar en la vida. Solo los hechos pueden convencerte.","proposal":"Cree en tus talentos e inteligencia. Sé confiable y práctico. O acércate a una mujer que encarne estas cualidades.","perspectives":"Tendrás oportunidades que utilizarás de forma práctica y eficiente.","love":"En el amor y las relaciones - una mujer de buen carácter, pero a menudo de voluntad fuerte, fiel, pragmática, llena de calidez sensual.","profession":"En profesión - una mujer confiable, práctica, realista, hábil y diligente.","generally":"En general - una mujer terrenal, realista, bondadosa, trabajadora, sensual y hermosa."},{"id":78,"name":"Rey de Pentáculos","description":"El Rey de Pentáculos se representa como un hombre rico, confiable y amante de los placeres.","meaning":"El crecimiento de la confiabilidad y la prosperidad, una inversión rentable de dinero o un hombre racional y práctico, que personifica la confiabilidad.","emotions":"Eres realista y sabes exactamente lo que significa el tema para ti. Estás mucho más interesado en las ganancias a largo plazo que en los beneficios inmediatos.","proposal":"Confía en tu propio juicio y experiencia práctica. Sé confiable y práctico, pero al mismo tiempo, no pierdas la capacidad de disfrutar la vida. O recurre a un hombre que encarne estas cualidades.","perspectives":"Usarás todas las oportunidades sabiamente, con tu realismo natural y te harás más rico.","love":"En el amor y las relaciones - un hombre bondadoso, pero a veces también duro, fiel, capaz de disfrutar la vida, lleno de calidez sensual.","profession":"En profesión - un hombre confiable, práctico, realista, hábil y diligente, un jefe.","generally":"En general - hombre realista, bondadoso, trabajador, sensual y hermoso."}]');
